The mutation, as shown in the previous chapter, is responsible for performing the mutation. Implement this to your use-case. public class CustomMutation : IMutation
{ public OpCode OriginalValue { get; set; } public OpCode NewValue { get; set; } public Instruction InstructionReference { get; set; } public void Mutate() { InstructionReference.OpCode = NewValue; } public void Reset() { InstructionReference.OpCode = NewValue; }
} Faultify provides a set of IMutation implementations that serve some general goals.

25.body:
IMutationAnalyzer has two generic parameters. The first one indicates the mutation type that is returned if the analyzer detects this mutation kind. The second one indicates in which scope the mutation can be found. The scope should be a type from Mono.Cecil such as: MethodDefinion, Instruction, FieldDefinition, TypeDefinition, AssemblyDefinition. The general idea is that the analyzer inspects this scope for some possible mutations and returns the generic mutation. In the following example, an analyzer that searches for add to sub mutations in the Instruction scope is demonstrated: public class CustomMutationAnalyzer : IMutationAnalyzer<CustomMutation, Instruction>
{ public string Description => "Addition to subtraction analyzer."; public string Name => "Addition to Subtraction"; public IEnumerable<CustomMutation> AnalyzeMutations(Instruction field, MutationLevel mutationLevel) { if (field.OpCode.Code == Code.Add) { yield return new CustomMutation() {OriginalValue = field.OpCode, NewValue = OpCodes.Sub}; } }
}

