A mutation is a change in operators, constant values, or variable declinations. Examples of possible mutations are: Arithmetic (+, -, /, *, %) Operators. Assignment Expressions (+=, -=, /=, *=, %=, — , ++). Equivalence Operators (==, !=). Logical Operators (&&, ||). Bitwise Operators (^,|, &). Branching Statements (if(condition), if(!condition)). Variable Literals (true, false). Mutate Constant Fields (string, number, boolean). The operators above should be mutated to a variant that invalidates the logic. For example, a ‘+’ can be changed to a ‘-’, ‘<’ to a ‘>’, ‘true’ to a ‘false’ etc… With some types of mutations, it may be possible that the mutation results in the same value such as ‘1 + 1’ to ‘1*1’, therefore for these mutations all variants ‘+, -, *, /’ should be performed for the best result. // Original
public int Add(a, b) { return a + b;
}
// Mutation 1
public int Add(a, b) { return a - b;
}
// Mutation 2
public int Add(a, b) { return a * b;
}
